import React from "react";
import { NavLink } from "react-router-dom";
import Nav from "./Nav";
function Profile() {
  return (
    <>
      <div className="home-container">
        <div className="home-content">
          <div className="home-bg">
            <Nav />
          </div>
        </div>
      </div>
    </>
  );
}

export default Profile;
